import { Component } from '@angular/core';
import { NavController, NavParams,  LoadingController, ModalController } from 'ionic-angular';
import { Validators, FormGroup, FormBuilder } from '@angular/forms';
import { Camera, CameraOptions } from '@ionic-native/camera';

import { EstimateCostPage } from '../../pages/estimate-cost/estimate-cost';
import { ChooseBikePage } from '../choose-bike/choose-bike';

/**
 * Generated class for the BookPage page.
 *
 * See https://ionicframework.com/docs/components/#navigation for more info on
 * Ionic pages and navigation.
 */

@Component({
  selector: 'page-book',
  templateUrl: 'book.html',
})
export class BookPage {
  private regForm: FormGroup;
  private submitClicked: boolean;
  base64Image: string;
  constructor(public navCtrl: NavController, public navParams: NavParams, private formBuilder: FormBuilder
    , private camera: Camera, public loadingCtrl: LoadingController, public modalCtrl: ModalController) {
    this.regForm = this.formBuilder.group({
      name: ['', Validators.required],
      dob: ['', Validators.required],
      gender: ['', Validators.required],
      address: ['', Validators.required],
      city: ['', Validators.required],
      image: ['']
    });

    this.setBaseImage();
  }

  ionViewDidLoad() {
    console.log('ionViewDidLoad BookPage');
  }
  setBaseImage() {
    this.base64Image = "data:image/png;base64,";
  }
  takePicture() {
    const options: CameraOptions = {
      quality: 100,
      destinationType: this.camera.DestinationType.DATA_URL,
      encodingType: this.camera.EncodingType.JPEG,
      mediaType: this.camera.MediaType.PICTURE,
    }

    this.camera.getPicture(options).then((imageData) => {
      // imageData is either a base64 encoded string or a file URI
      // If it's base64:
      this.base64Image = 'data:image/jpeg;base64,' + imageData;
    }, (err) => {
      // Handle error
    });
  }
  presentLoading() {
    this.loadingCtrl.create({
      content: 'Please wait...',
      duration: 3000,
      dismissOnPageChange: true
    }).present();
  }
  bookService(){
    this.presentLoading();
  }
  estimateCost(){
    let modal = this.modalCtrl.create(EstimateCostPage);
    modal.present();
  }
  chooseBike(){
    let modal = this.modalCtrl.create(ChooseBikePage);
    modal.present();
  }
}
